# if clock decays with rate np.exp(q1), p for coin tosses is 1 - np.exp(-q1*del_t)

q = [[0,10e-7,10e-7,10e-7], [10e-7,0,10e-7,10e-7], [10e-7,10e-7,0,10e-7], [10e-7,10e-7,10e-7,0]]
p = []

for i in range(4):
    p.append([])
    for j in range(4):
        p[i].append(np.exp(-q[i][j]*del_t))
    p.append([])


#useful for multiplication


stoch_mat = []

for i in range(4):
    stoch_mat.append([])
    prod =1
    sum = 0
    for j in range(4):
        prod = prod*p[i][j]
        sum = sum+q[i][j]
    for j in range(4):
        if i==j:
            stoch_mat[i].append(prod)
        else:
            stoch_mat[i].append(q[i][j]*(1-prod)/sum)


#because adithya asked me to
